const App = () => {
  // const count = useSelector((state)=>state.counter.value)
  return <div>
  {/* {count}  */}
    <div>
      <Navbar/>
    </div>
    <div>
      <Routes>
        <Route path="/" element=<Home/> />
        <Route path="/cart" element=<Cart/> />
      </Routes>
    </div>
  </div>;
};

export default App;
